Для того, чтобы в стране стало получше необходимо выполнить 5 пунктов программы по борьбе с Путиновирусом "Путинизм-20":
1)перерезать глотку Путину;
2) перерезать глоткуМишустину;
3) перерезать глотку Медведеву;
4) перерезать глотки Грефу, Силуанову, Усманову, Сечину, Роттенбергам, Набиулиной;
5) перерезать глотки всей остальной путинской мразоте, ой простите, элите.

@Света Королева у   нас   в  стране   до   сих   пор нет   лекарства   от   многих- многих    болезней.
