@Валентин Тытюк Вы с Украины? Враждебного государства для России.
Мой отец воевал в Украинском фронте - с 15,5 лет. Вместе со своим отцом ушел на фронт. Вернулся с войны весь контуженный, в осколках. Но весь в орденах!-в т.ч.полный кавалер ордена Славы! Он умер в 58л. Если бы он знал что Украина будет нам враг - не за что бы не поверил.
Что значит - лучше воевать? У него половина родственников - осталась лежать на чужбине!!! А то что он вернулся живым - это чудо. Они не жалели своих жизней (ордена не давали просто так!-а только за подвиги!) - защищая свою Родину, своих близких (и таких подонков как вас)!!! 😈😈😈😈😈😈😈😈😈
